const INITIAL_STATE = {
  data:[]
}

export default function AssetDevicesReducer(state = INITIAL_STATE, action) {
    switch (action.type) {
      case "FETCH_ASSET_DEVICES":
        console.log({data: [...state.data, action.payload]});
        return { data: [...state.data, action.payload] };
      default:
        return state;
    }
  }
